import { AppBar, Toolbar } from "@material-ui/core";

const Header = () => (
  <AppBar position="sticky">
    <Toolbar>
      <Typography variant="h6">Tracthon</Typography>
      <Button color="inherit">Login</Button>
    </Toolbar>
  </AppBar>
);

export default Header;
